import React from 'react'
import styled from 'styled-components'
import { PostItem } from './PostItem'

const List = styled.div`
  max-width: 400px;
  margin: 0 auto;
  display: flex;
  flex-direction: column;
  & > *:not(:first-child) {
    margin-top: 20px;
  }
`

/**
 * @typedef {{key: string, name: string, date: string, text: string}} Post
 * @param {{posts: Post[]}} props
 **/

//  const Data = React.lazy(
//   () =>
//     new Promise((resolve) => {
//       setTimeout(() => {
//         resolve(import('./Data'))
//       }, 3000)
//     })
// )
export function PostsList(props) {
  return (
    <React.Suspense fallback={<h1>Loading posts...</h1>}>
      <List>
        {props.posts.map((item) => (
          <PostItem
            key={item.key}
            name={item.name}
            date={item.date}
            text={item.text}
          />
        ))}
      </List>
    // </React.Suspense>
  )
}
